package com.basic;

public class TableProgram {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        int num = 0;
        for(int i=1;i<=1;i++)
        {
        	for(int j=0;j<=100;j++)
        	{
        		num = i+j;
        		System.out.println(num+" ");
        		
        }
		System.out.println();
		
	}

	}
}